import React from "react";

class Button extends React.Component {
    render () {
        return <button onClick={console.log("trykka")} className="home-button btn btn-primary btn-lg">Some button</button>
    }
}

class Home extends React.Component {
    constructor(props) {
        super(props);

    }

    handleClick() {
        console.log('Click happened');
    }

    render() {
        return (
            <div>
                <h2 className="text-center text-white">Logget inn som: <b>[Username]</b></h2>
                <br></br>
                <div className="d-flex flex-row bd-highlight mb-2 justify-content-center">
                    <div className="p-2">
                        <Button />
                    </div>
                    <div className="p-2">
                        <button type="button" className="home-button btn btn-primary btn-lg">Aktive meldinger</button>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
